#include <iostream>
#include <vector>
#include <string>

using namespace std;

class Solution {
public:
    char findTheDifference(string s, string t) {
        vector<int> list(26, 0);
        for (int i = 0; i < s.size(); ++i) {
            list[s.at(i) - 97] = list[s.at(i) - 97] + 1;
        }

        for (int i = 0; i < 26; ++i) {
            cout << list[i] << " ";
        }
        cout << endl;

        for (int i = 0; i < t.size(); ++i) {
            list[t.at(i) - 97] = list[t.at(i) - 97] - 1;
        }

        for (int i = 0; i < 26; ++i) {
            cout << list[i] << " ";
        }
        cout << endl;

        for (int i = 0; i < 26; ++i) {
            if (list[i] == -1) {
                return (char)(97 + i);
            }
        }
        return ' ';
    }
};

int main () {
    /*string ss = "abcd";
    string tt = "cdfba";
    */
    string ss = "";
    string tt = "";
    Solution s;
    cout << s.findTheDifference(ss, tt) << endl;

    return 0;
}
